import * as React from 'react';
// import '../App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Grid } from '@mui/material';
import Divider from '@mui/material/Divider';
import { motion } from 'framer-motion';
import StackedNavbar from './StackedNavbar';
import { useState } from 'react';
import projects from '../files/projects.json';
import Box from '@mui/material/Box';
import Drawer from '@mui/material/Drawer';
import Button from '@mui/material/Button';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import Info from '@mui/icons-material/Info';
import Paper from '@mui/material/Paper';
import { styled } from '@mui/material/styles';

const bg = getComputedStyle(document.body).getPropertyValue('--bg');
const offWhite = getComputedStyle(document.body).getPropertyValue('--off-white');
const Title = styled(Paper)(({ theme }) => ({
  backgroundColor: bg,
  padding: theme.spacing(0.5),
  marginLeft: theme.spacing(3),
  textAlign: 'left',
  color: 'white'
}));

const Header = styled(Paper)(({ theme }) => ({
  backgroundColor: bg,
  padding: theme.spacing(0.5),
  marginRight: theme.spacing(3),
  textAlign: 'left',
  color: 'white'
}));

const Description = styled(Paper)(({ theme}) => ({
  backgroundColor: bg,
  ...theme.typography.body2,
  padding: theme.spacing(0.5),
  marginRight: theme.spacing(3),
  marginLeft: theme.spacing(3),
  textAlign: 'left',
  color: 'white'
}));

function ProjectContainer(props) {
  const blue2 = getComputedStyle(document.body).getPropertyValue('--blue2');

  return (
    <div className='project-container'>
      <React.Fragment key={props.name}>
        <div className='project-info'>
          <Grid container rowSpacing={1} columnSpacing={1}>
            <Grid item sm={12} md={7}>
              <Title>{props.name}</Title>
            </Grid>
            <Grid item md={5}>
              <Header>Date</Header>
            </Grid>
          {/* </Grid> */}
          {/* <Grid container> */}
            <Grid item md={12}>
              <Paper>Description</Paper>
            </Grid>
          {/* </Grid> */}
          {/* <Grid container> */}
            {/* add code to render a grid item for each tool used */}
            {/* to adjust the height of the paper add a height css parameter */}
            <Grid item >
              <Paper>CSS</Paper>
            </Grid>
          </Grid>
          {/* <div className='project-header'>
            <p>{props.name}</p>
            <p>Date</p>
          </div>
          <div className='project-desc'>
            <p>some text</p>
          </div> */}
        </div>
      </React.Fragment>
    </div>
  );
}

export default ProjectContainer;
